import React, { useState, useEffect } from 'react';

function UserTable({ users, onDelete, onUpdate }) {
  const [editUserId, setEditUserId] = useState(null);
  const [formData, setFormData] = useState({});
  const [currentPage, setCurrentPage] = useState(1);

  const usersPerPage = 10;
  const totalPages = Math.ceil(users.length / usersPerPage);

  useEffect(() => {
    // Reiniciar a la página 1 si cambia la lista de usuarios
    setCurrentPage(1);
  }, [users]);

  const handleEditClick = (user) => {
    setEditUserId(user.userId);
    setFormData({ ...user });
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({ ...prev, [name]: value }));
  };

  const handleSubmit = () => {
    onUpdate(formData);
    setEditUserId(null);
  };

  const handleCancel = () => {
    setEditUserId(null);
    setFormData({});
  };

  const handlePrevPage = () => {
    setCurrentPage(prev => Math.max(prev - 1, 1));
  };

  const handleNextPage = () => {
    setCurrentPage(prev => Math.min(prev + 1, totalPages));
  };

  // Obtener solo los usuarios visibles para la página actual
  const startIndex = (currentPage - 1) * usersPerPage;
  const currentUsers = users.slice(startIndex, startIndex + usersPerPage);

  return (
    <div>
      <table border="1" cellPadding="10">
        <thead>
          <tr>
            <th>ID</th><th>Nombre</th><th>Email</th><th>Contraseña</th><th>Rol</th><th>Acciones</th>
          </tr>
        </thead>
        <tbody>
          {currentUsers.map(user => (
            editUserId === user.userId ? (
              <tr key={user.userId}>
                <td>{user.userId}</td>
                <td><input name="name" value={formData.name || ''} onChange={handleChange} /></td>
                <td><input name="email" value={formData.email || ''} onChange={handleChange} /></td>
                <td><input name="password" value={formData.password || ''} onChange={handleChange} /></td>
                <td>
                  <select name="role" value={formData.role || ''} onChange={handleChange}>
                    <option value="duenio">Dueño</option>
                    <option value="asistente">Asistente</option>
                    <option value="veterinario">Veterinario</option>
                  </select>
                </td>
                <td>
                  <button onClick={handleSubmit}>Guardar</button>
                  <button onClick={handleCancel}>Cancelar</button>
                </td>
              </tr>
            ) : (
              <tr key={user.userId}>
                <td>{user.userId}</td>
                <td>{user.name}</td>
                <td>{user.email}</td>
                <td>{user.password}</td>
                <td>{user.role}</td>
                <td>
                  <button onClick={() => handleEditClick(user)}>Editar</button>
                  <button onClick={() => onDelete(user.userId)}>Eliminar</button>
                </td>
              </tr>
            )
          ))}
        </tbody>
      </table>

      {totalPages > 1 && (
        <div style={{ marginTop: '10px', display: 'flex', alignItems: 'center', gap: '1rem' }}>
          <button onClick={handlePrevPage} disabled={currentPage === 1}>Anterior</button>
          <span>Página {currentPage} de {totalPages}</span>
          <button onClick={handleNextPage} disabled={currentPage === totalPages}>Siguiente</button>
        </div>
      )}
    </div>
  );
}

export default UserTable;
